h4 {
    display: inline-block;
    border: 0 solid #e91e63;
    color: #c2185b;
    border-top-width: 3px;
    border-left-width: 10px;
    padding: 4px;
    font-weight: 700;
}
.q-field__label .no-pointer-events .absolute .ellipsis{
    color:white;
}
#home-packages h5>strong, #corporate-page-intro h5, #corporate-page-company_story h5, #corporate-page-packages h5, #corporate-page-singles h5 {
      display: inline-block;
      border: 0 solid #e91e63;
      color: #c2185b;
      border-top-width: 3px;
      border-left-width: 10px;
      padding: 4px;
      font-weight: 700;
}
.package {
    box-sizing: border-box;
    width: 220px;
    height: 380px;
    border: 3px solid #e8e8e8;
    border-radius: 7px;
    display: inline-block;
    padding: 24px;
    text-align: center;
    float: left;
    transition: margin-top .5s linear;
    position: relative;
    margin-right: 11px;
}
.package:hover {
    margin-top: -30px;
    transition: margin-top .3s linear;
}
.name {
    color: #565656;
    font-weight: 600;
    font-size: 2rem;
    margin-top: -5px;
}
.price {
    margin-top: 7px;
    font-weight: bold;
    font-size: 1.5rem;
}
.price::after {
    /*content: " / month per user";*/
    font-weight: normal;
}
hr {
    background-color: #dedede;
    border: none;
    height: 1px;
}
.trial {
    font-size: .9rem;
    font-weight: 600;
    padding: 2px 21px 2px 21px;
    color: #ffffff;
    border: 1px solid #e4e4e4;
    display: inline-block;
    border-radius: 15px;
    background-color: rgb(5, 18, 189);
    position: relative;
    bottom: -20px;
}
ul {
    list-style: none;
    padding: 0;
    text-align: left;
    margin-top: 29px;
}
li {
    margin-bottom: 15px;
}
li:before {
    font-size: 1.3rem;
    color: #0512bd;
    margin-right: 3px;
}

  /*.checkIcon, li:before, .brilliant::after {
    font-family: "FontAwesome";
    content: "\f00c";
  }*/
.brilliant {
    border-color: #0512bd;
}
.brilliant::before {
    width: 0;
    height: 0;
    border-style: solid;
    border-width: 64px 64px 0 0;
    border-color: #0512bd transparent transparent transparent;
    position: absolute;
    left: 0;
    top: 0;
    content: "";
}
.brilliant::after {
    color: white;
    position: absolute;
    left: 9px;
    top: 6px;
    text-shadow: 0 0 2px #37c5b6;
    font-size: 1.4rem;
}
.pricingdiv{
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    font-family: 'Source Sans Pro', Arial, sans-serif;
}
.pricingdiv ul.theplan{
    list-style: none;
    margin: 0;
    padding: 0;
    display: flex;
    flex-direction: column;
    border-top-left-radius: 50px;
    border-bottom-right-radius: 50px;
    color: white;
    background: radial-gradient(circle, #7c3ac9 0%, #014a88 100%);
    position: relative;
    width: 230px; /* width of each table */
    margin-right: 10px; /* spacing between tables */
    margin-bottom: 1em;
    transition: all .5s;
}
.pricingdiv ul.theplan:hover{ /* when mouse hover over pricing table */
    transform: scale(1.05);
    transition: all .5s;
    z-index: 100;
    box-shadow: 0 0 10px gray;
}
.pricingdiv ul.theplan li{
    margin: 10px 20px;
    position: relative;
}
.pricingdiv ul.theplan li.title{
    font-size: 150%;
    font-weight: bold;
    text-align: center;
    margin-top: 20px;
    text-transform: uppercase;
    border-bottom: 5px solid white;
}
.pricingdiv ul.theplan:nth-of-type(2){
    background: #e53499;
}
.pricingdiv ul.theplan:nth-of-type(3){
    background: #2a2cc8;
}
.pricingdiv ul.theplan:last-of-type{ /* remove right margin in very last table */
    margin-right: 0;
}

  /*very last LI within each pricing UL */
.pricingdiv ul.theplan li:last-of-type{
    text-align: center;
    margin-top: inherit; /*align last LI (price botton li) to the very bottom of UL */
}
.pricingdiv a.pricebutton{
    background: white;
    text-decoration: none;
    padding: 10px;
    display: inline-block;
    margin: 10px auto;
    border-radius: 5px;
    color: navy;
    text-transform: uppercase;
}
@media only screen and (max-width: 500px) {
.pricingdiv ul.theplan{
      border-radius: 0;
      width: 100%;
      margin-right: 0;
}
.pricingdiv ul.theplan:hover{
      transform: none;
      box-shadow: none;
}
.pricingdiv a.pricebutton{
      display: block;
